    def pretty(self, s, n, split):
        """
        This method have a responsibility for splitting strings.
        :param s: a number string.
        :param n: the length of every piece.
        :param split: the connecting-character.
        :return: return a pretty split number string.
        """
        return split.join([s[i:i + n] for i in range(0, len(s), n)])

    def text_changed(self):
        """
        This method have a responsibility for monitoring whether range-text is changed or not.
        """
        self.range_changed = True

    def get_length(self):
        """
        This method have a responsibility for getting self.length(list). This is a list contains random numbers.
        These numbers will be set as the random string's length.
        :return: don't return anything.
        """
        len_min, len_max = self.text_min.text().strip(), self.text_max.text().strip()
        if not len_min:
            len_min = '1'
        elif not (len_min.isdigit() and 1 <= int(len_min) <= 32767):
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"错误", u"长度值必须是在1~32767范围内的整数！", QMessageBox.Cancel)
            return

        if not len_max:
            len_max = '32767'
        elif not (len_max.isdigit() and 1 <= int(len_max) <= 32767):
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"错误", u"长度值必须是在1~32767范围内的整数！", QMessageBox.Cancel)
            return

        len_min, len_max = int(len_min), int(len_max)

        if len_min > len_max:
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"错误", u"长度最小值不能大于最大值！", QMessageBox.Cancel)
            return

        self.length = random.sample(range(len_min, len_max + 1), len_max - len_min + 1)

    def set_random_string(self):
        """
        This method have a responsibility for setting random string to the application.
        First it will attempt to get length from self.length. If the list is empty, it will return and do nothing.
        The random string may have letters and digits depending on users' choice. If all the checkboxes are not checked,
        the random string will have letters and digits both.
        :return: don't return anything.
        """
        if not self.length:
            winsound.PlaySound('SystemExclamation', winsound.SND_ASYNC)
            QMessageBox.information(self, u"信息", u"看起来这个范围的长度你都挑战过了呢！\n换个长度范围吧！",
                                    QMessageBox.Cancel)
            return
        else:
            table = ''
            if self.has_num.isChecked():
                table += string.digits
            if self.has_alpha.isChecked():
                table += string.ascii_letters
            if not table:
                table = string.ascii_letters + string.digits
            self.current_text = ''.join([random.choice(table) for _ in range(self.length[-1])])
            self.length.pop()
            self.random_str.setText(u"生成随机字符串：\n" + self.pretty(self.current_text,
                                                                ceil(self.centralwidget.width() // 14) + 5,
                                                                '\n'))

    def generate(self):
        """
        This method have a responsibility for checking the length range and generate and set random string to app.
        """
        if self.range_changed:
            self.range_changed = False
            self.get_length()
        self.set_random_string()

    def confirm(self):
        """
        This method have a responsibility for calculating the accuracies and set them to the application after
        pressing the confirm button.
        """
        text_input = self.text_input.toPlainText()
        result = u"正确率：\n"
        # 1. difflib
        sim = difflib.SequenceMatcher(None, self.current_text, text_input).ratio()
        result += u"SequenceMatcher算法：" + str(sim) + "\n"

        # 2. Hamming distance. The length of two strings must be the same.
        # It describes the number of different characters in the corresponding position between two equal length strings
        if len(self.current_text) == len(text_input):
            sim = (len(text_input) - Levenshtein.hamming(self.current_text, text_input)) / len(text_input)
            result += u"Hamming距离算法：" + str(sim) + "\n"

        # 3. Levenshtein ratio. Levenshtein distance describes the minimum number of operations
        # to convert one string to another.
        sim = Levenshtein.ratio(self.current_text, text_input)
        result += u"Levenshtein距离算法：" + str(sim) + "\n"

        # 4. Jaro distance
        sim = Levenshtein.jaro(self.current_text, text_input)
        result += u"Jaro距离算法：" + str(sim) + "\n"

        # 5. Jaro-Winkler distance
        sim = Levenshtein.jaro_winkler(self.current_text, text_input)
        result += u"Jaro-Winkler距离算法：" + str(sim)

        self.accuracy.setText(result)
